(1, 'termsandconditions', 'Terms of Use', '<strong>General remarks</strong>\r\nThis is an agreement between you and sellnepal.com. This agreement governs your use of sellnepal.com and all its services. sellnepal.com provides its services free of cost and free of registration.\r\n\r\nIt is important that you read the terms and conditions carefully, even if it is not so easy like the website ;-) Take your time!\r\n\r\nIf you do not agree with these statements, please refrain from accessing the site and any of its services. These terms and conditions are subject to changes and modifications from time to time. All amendments will become active within 48 hours after they have been posted and anyhow, by using the service in any way, you are agreeing to comply with these terms and conditions.\r\n\r\n<strong>What is sellnepal.com?</strong>\r\n\r\nsellnepal.com is a community site with the purpose to establish contacts especially for the buying and selling of goods through classifieds on the WWW.\r\n\r\nsellnepal.com only provides information entered by our users! You understand that all information you enter (including images or external links or any other material or any other information you enter or link in or out), referred to hereafter as "listing" or "items" or "information", are the sole responsibility of the user entering the information. The right to publish any material, or edit it, lies solely with the user and if you have posted it, with you.\r\n\r\nsellnepal.com is a platform which hopefully helps you to find information, trading or communication partners. sellnepal.com only provides a platform which enables you to find information, publish information or communicate with one another. sellnepal.com does not have any control over the quality of the listing; it\'s pricing, or the issue of guarantees and warranties on items for trade or control in any manner any transaction or information exchange between the users of this site. Accordingly:\r\n\r\nsellnepal.com  