find other user\'s information to be offensive, harmful, inaccurate, or deceptive. Please use caution, common sense, and practice safe trading when using the site. It is up to you to evaluate the given information and you bear the risks associated of using the site (e.g. also clicking external links). Please note that there are also risks of dealing with foreign nationals, underage persons or people acting under false pretense.\r\n\r\nSo you agree that the use of sellnepal.com is at your own risk. sellnepal.com is not liable in any way.\r\n\r\n<strong>Your information is true!</strong>\r\n\r\nYou attest that all information provided by you to the sellnepal.com platform is accurate. If you provide any information that is untrue, inaccurate, not current or incomplete or sellnepal.com has reasonable grounds to suspect that such information is untrue, inaccurate, not current or incomplete, or not in accordance with the terms and conditions, sellnepal.com has the right to indefinitely suspend or terminate the relation with you, delete any of your content from the website and refuse to provide you with access to the site.\r\n\r\n<strong>sellnepal.com is allowed to terminate the users access</strong>\r\nsellnepal.com may edit, delete listings, block the users IP address or terminate the users access without giving any reason, without prior notice and for whatever reason and without liability to the user or any third party for this. This is especially the case if:\r\n\r\n<strong>You breach this agreement.</strong>\r\n\r\nsellnepal.com cannot verify or authenticate the information provided by you.\r\nsellnepal.com believes that your actions may cause you loss, or believes that your actions may cause any type of loss to sellnepal.com or other users of sellnepal.com.\r\n\r\nIf any irrelevant classified has been posted under any category/city.\r\n\r\n<strong>Electronic communication</strong>\r\n\r\nAll communication between sellnepal.com and its members will be through email only. All such electronic documents are legal equivalents to written documents and will be treated as the same.\r\n\r\n<strong>Control of information</strong>\r\n\r\nBy posting all materials and information at sellnepal.com, you grant sellnepal.com the permission to:\r\n\r\n<strong>Send promotional and informational email to you.</strong>\r\n\r\nUse, copy, distribute, transmit, or translate.\r\n\r\nSub license these rights to an extent that is permissible by law.\r\n\r\nsellnepal.com will not pay you for any submission and we reserve the right to remove your submission at any point.\r\n\r\n<strong>Liability limitation</strong>\r\n\r\nUnder no circumstances will sellnepal.com be held liable for any damages, including without limitation any indirect, consequential, special, incidental, or punitive damages arising out of, based on, or resulting from this agreement or your use of the web site, even if sellnepal.com has been advised by any party of the possibility of such damages. sellnepal.com is not liable for links to external websites which you may find on the website. If you are dissatisfied with sellnepal.com or its affiliates, you do not agree with any part of this agreement, or you have any other dispute or claim with or against sellnepal.com with respect to this agreement, then your sole and exclusive remedy is to discontinue using the web sites.\r\n\r\n<strong>Personal details</strong>\r\n\r\nAll personal contact details that you provide us with upon posting content on the website and during your use of our services, must be authentic and accurate. If you provide any information that is untrue, inaccurate, not current or incomplete or sellnepal.com has reasonable grounds to suspect that such information is untrue, inaccurate, not current or incomplete, or not in accordance with the terms and conditions, sellnepal.com  has the right to indefinitely suspend or terminate the relation with you, delete any of your content from the website and refuse to provide you with access to the site.\r\n\r\n<strong>Your posting is not a contract nor a binding offer!</strong>\r\n\r\nYour posting is not a contract. By posting you are not entering into an agreement to complete the transaction.\r\n\r\n<strong>Your reply to a post is not a contract nor a binding offer!</strong>\r\n\r\nYour reply to a posting is not a contract nor a binding offer. By responding to a posting you are not entering into an agreement to complete the transaction. It is simply a first step of your general interest, such as entering a shop will not force you to buy something.\r\n\r\n\r\n<strong>Post a listing</strong>\r\n\r\nAll listings or all information you provide to sellnepal.com must be legal in Nepal .Try to describe your posting as accurately as possible. Misrepresentation of your posting through description, images, functionality and price will be viewed as fraud.\r\n\r\nIn general, non-completion of a sale for reasons other that those outlined above will be viewed as seller fraud and will be dealt with accordingly.\r\n\r\n<strong>Restricted activity</strong>\r\n\r\nThe site (sellnepal.com) and its services may only be used to lawful purposes alone and in a lawful manner. You may not act under a false name. You may not show interest under a false identity or impersonate another user. Such fraudulent activity may be reported to the concerned law enforcement authorities and violators could be prosecuted. At no point of time during your use of our site your activities shall involve the following:\r\n\r\nA posting that, directly or indirectly, offer, attempt to offer, trade or attempt to trade in any item, the dealing of which is prohibited or restricted in any manner under the provisions of any applicable law, rule, regulation or guideline for the time being in force in any way.\r\nThe offer to sale of items that are stolen.\r\n\r\nUploading viruses or bugs onto the server or any other activity that may cause sellnepal.com to lose control over its ISP\'s or that may damage, detrimentally interfere with, surreptitiously intercept or expropriate any system, data or personal information.\r\n\r\nContact anyone who has asked not to be contacted.\r\n\r\nCollect data on the sellnepal.com website about other users for commercial or unlawful usage.\r\n\r\nInfringe on a third party\'s rights, especially copyright, trademark, or patent as this could also land you in legal trouble.\r\n\r\nThe use of pornographic images or articles. Use abusive, sexually explicit or derogatory language.\r\n\r\nLinking images, feedback or articles from another site especially if they are copyrighted or get attracted under intellectual property rights.\r\nDo any activities, which shall directly or indirectly amount to hacking.\r\n\r\nLiving, dead creatures and/or the whole or any part of any animal which has been kept or preserved by any means whether artificial or natural including rugs, skins, specimens of animals, antlers, horns, hair, feathers, nails, teeth, musk, eggs, nests, other animal products of any description the sale and purchase of which is prevented or restricted in any manner by applicable laws.\r\n\r\nWeapons of any description.\r\n\r\nLiquor, tobacco products, drugs, psychotropic substances, narcotics, intoxicants of any description, medicines, palliative/curative substances.\r\n\r\nUse robot, spider, scraper or other automated means to access the Site for any purpose without our express written permission is prohibited.\r\n\r\nYou will not engage in any activity that may interfere in proper working of the any measures we use to restrict access to our website.\r\n\r\nThere will be no misuse or use of content that is not yours without prior consent.\r\n\r\nThere will be no unauthorized access to data that is private and confidential.\r\n\r\nAny religious items, including books, artifacts, etc. which is likely to affect the religious sentiments of any person.\r\n\r\n"Antiquities" and "Art Treasures" in violation of the provisions.\r\n\r\nDefamatory, trade libelous, unlawfully threatening or unlawfully harassing.\r\n\r\nLink directly or indirectly to or include descriptions of items, goods or services that are prohibited under the terms and conditions;\r\nyou do not have a right to link to or include.\r\n\r\nHelp us to find restricted activity: Please send us an email to <a href="mailto:info@sellnepal.com ">info@sellnepal.com </a> in case you find any restricted activity on sellnepal.com.\r\n\r\n<strong>Fee and services</strong>\r\n\r\nsellnepal.com does not charge any fee. Its 100% Free of Cost.\r\n\r\n<strong>Interference</strong>\r\n\r\nsellnepal.com and you are independent contractors and this agreement or the use of sellnepal.com services does not imply any partnership, joint venture, employee-employer or franchisee-franchise relationship.\r\n\r\n<strong>Indemnity</strong>\r\n\r\nThe user agrees to defend, indemnify and hold sellnepal.com and all its affiliates harmless from all claims and expenses including attorney\'s fees, arising out of the use of sellnepal.com by the user.\r\n\r\n<strong>Technical glitches</strong>\r\n\r\nsellnepal.com offers 100% risk free classifieds and postings in the sense that the listing has not a legal binding nature. In case of a technical glitch, sellnepal.com reserves the right to stop, restart, or cancel any listing at any time, including before, during and after. It is in the best interest of all users to print a copy or write down the listing number of each listing. It is the sole responsibility of the user to maintain the listing unique ad id.\r\n\r\n<strong>Legal compliance and governing law</strong>\r\n\r\nYou shall agree to comply with all statutes - including domestic, international, trade regulations, such restrictions imposed by sellnepal.com, or government regulations being introduced from time to time by any authorities in Nepal. The above terms and conditions shall be governed in Nepal.\r\n\r\n<strong>Salvadoran clause</strong>\r\n\r\nIf this contract or any part of it may be illegal, invalid, unenforceable or inaccurate specified, this does not mean that the whole terms and conditions are invalid and the other parts of the terms and conditions remain in full force and effect. The user agrees that it will be displaced by a legal solution which is as nearby as possible to the originally intended one.\r\n\r\n<strong>Partner sites</strong>\r\nWe reserve the rights to display the classifieds/events on our partner sites.\r\n\r\n<strong>sellnepal.com is a service of Lamputer.</strong>', '2016-02-22 18:32:50', '2016-02-22 18:32:50', NULL),
(2, 'privacy-policy', 'Privacy Policy', 'sellnepal.com values the privacy of information pertaining to its associates. We do not use or disclose information about your individual visits to our website.\n\nBy posting on our site you give us the permission to display your content on our affiliate sites. Sellnepal.com carefully selects the affiliates sites with which we can share our information.\n\nBy posting on sellnepal.com, you agree to receive promotional communications from us (email and/or SMS) unless you specifically indicate otherwise in writing to us at <a href="mailto:info@sellnepal.com ">info@sellnepal.com</a>.\n\nWe will enable you to communicate your privacy concerns to us and that we will respond to them appropriately. If you have any questions about our privacy policy, please contact us at <a href="mailto:info@sellnepal.com ">info@sellnepal.com</a>.', '2016-02-22 18:32:50', '2016-02-22 18:32:50', NULL),
(3, 'how-to', 'How to publish Ads?', '<strong>Step1</strong>\n<p>First you need to login or register to post your ads. You can login or register from facebook or google easily.</p>\n<p><img src="http://sellnepal.com/how-to/step1-min.png" alt=""></p>\n<strong>Step2</strong>\n<p>If you are a dealer and want to publish many ads at once. You need to register as Business account selecting Business(For Company, Shop) on account type. If you have registered from facebook you need to update your profile selecting Account type as your requirements.</p>\n<p><img src="http://sellnepal.com/how-to/step2-min.png" alt=""></p>\n<strong>Step3</strong>\n<p>You need to update your profile before posting ads with your appropriate information.</p>\n<p><img src="http://sellnepal.com/how-to/step3-min.png" alt=""></p>\n<strong>Step4</strong>\n<p>If you have updated your profile. You can click on place an ad  button to add your items.</p>\n<p><img src="http://sellnepal.com/how-to/step4-min.png" alt=""></p>\n<strong>Step5</strong>\n<p>You can now choose your item category and click proceed button to continue.</p>\n<p><img src="http://sellnepal.com/how-to/step5-min.png" alt=""></p>\n<strong>Step6</strong>\n<p>Once you have selected your category you can now fill your items info and featured image and click proceed to continue. Please fill all required fields marked with *.</p>\n<p><img src="http://sellnepal.com/how-to/step6-min.png" alt=""></p>\n<strong>Step7</strong>\n<p>Upload your items images which appear in gallery on you item page. And you are Done.</p>\n<p><img src="http://sellnepal.com/how-to/step7-min.png" alt=""></p>\n<strong>Step8</strong>\n<p>Now you can view your published ads in your My ads. where you can mark it as sold, add/change images, edit your add or delete your ad.</p>\n<p><img src="http://sellnepal.com/how-to/step8-min.png" alt=""></p>\n<p>Enjoy Free Classified to promote your Business.</p>', NULL, NULL, NULL);
