(22, 'rbwile-furnished-bungalow-on-rent-at-maharajgunj-near-chundevi-temple-ad-103', 'Furnished bungalow on rent at Maharajgunj, near Chundevi temple', '<p style="margin: 0px 0px 6px; color: #141823; font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px;">A beautiful bungalow on rent with basic furniture in peaceful residential area located at Chundevi(Ganeshbasti), very less walking distance to Chundevi temple, US Embassy and ring road or Baluwatar, easy access to get everything and facilities nearby.</p>\r\n<p style="margin: 6px 0px; color: #141823; font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px;">Basement: 1 maid room and 1 bathroom/toilet<br />Ground floor: 1 lobby, 1 specious living hall, 1 kitchen, 1 dining, 1 guest room and 1common toilet/bath room&nbsp;<br />1rst floor: 2 attached bed rooms including a master bedroom, 1 living spa<span class="text_exposed_show" style="display: inline;">ce and east and south faced balcony&nbsp;<br />Top floor: 1 bed room, Pooja(worship) room, big terrace, water tank, solar panel.</span></p>\r\n<div class="text_exposed_show" style="display: inline; color: #141823; font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px;">\r\n<p style="margin: 0px 0px 6px;">Garage and ample parking space for 3 cars and some more bikes, beautiful garden and some vegetable planting land&nbsp;<br />Some more opened space at all side of the house<br />Facilities of enough 24 hrs drinking water with hot shower,<br />24 hrs Wi-Fi and power back up<br />Highly compounded surrounding the house<br />The bungalow is prefer for those persons who living very long term</p>\r\n<p style="margin: 6px 0px;">Rent is $1100/month,(negotiation can be depends on time duration you living)<br />Any interested, let me know-9851189 417.</p>\r\n</div>', '', 110000, 'publish', 19, 188, 1, 214, 1, 3, 0, '2016-04-05 06:20:23', '2016-09-10 20:35:28', NULL),
