(126, 'nceary-healthy-french-bulldog-puppies-for-adoption-ad-95', 'Healthy French Bulldog Puppies for ADOPTION.', '<p>These adorable French Bulldog pups are ready to find their forever home. These little ones are raised in our home with constant contact to family. They love running and playing and licking toes, a very reliable, loving, and gentle breed, this dog makes an excellent companion for children and adults Mom weighs 5 lbs and dad is 6 lbs. they are vet check examined, dewormed and firstly vaccinated. State Health Certificates with each puppy. Excellent temperaments and health contact us for more info and pics.</p>', '', 240, 'publish', 34, 181, 1, 40, 0, 3, 0, '2016-07-13 00:07:39', '2016-09-08 14:55:01', NULL),
(127, 'eaj2rn-beautiful-african-grey-parrots-for-adoption-ad-131', 'BEAUTIFUL AFRICAN GREY PARROTS FOR ADOPTION', '<p>Hand-reared African Grey Baby Parrots ready soon. All my babies are hand-reared from 3wks old and are all super-tame and well handled.They used to being around small children and used to a busy household. Me and the wife hand-rear all our baby Greys in small clutches so that each one gets lots of human attention at a very early age to ensure that all the parrots are completely tame and easy to handle and DO NOT BITE so they can have a wonderful life with their new mums &amp; dads. All the babies are weaned on tropical seed mix and fresh fruit and veg. I only let my babies go to their new homes when they are able to eat and drink independently and am sure that they are ready for the big move.The pictures of baby parrots above are of my baby parrots not copy and pasted off other people or other sites :-)</p>\r\n<p>&nbsp;</p>\r\n<p>All the babies will be sold with a hatch certificate and ID steel rings (close rung) on their legs and i provide 24hrs after care service for total peace of mind. I am happy to help with any questions or concerns you may have prior to purchasing regarding cages,housing, diet, vet details or any other concern you may have i will be happy to help.</p>\r\n<p>&nbsp;</p>\r\n<p>you will not find tamer and sociable babies than these anywhere guaranteed..</p>', '', 15000, 'publish', 34, 183, 1, 26, 0, 3, 0, '2016-07-13 00:28:05', '2016-09-08 14:55:07', NULL),
(128, 'gqvn2q-quality-male-and-female-siberian-husky-puppies-ad-49', 'Quality Male and Female Siberian Husky Puppies ', '<p>These puppies will make ideal family pets &amp; companions and have been handled by children and adults from birth. They are very well socialised, are used to children as well as all the usual household noises and have even been taken out in the car to get them used to travelling. These puppies have been responsibly bred from health tested parents who both have wonderful natures. This has helped ensure we have happy, healthy and outgoing pups.</p>\r\n<p>&nbsp;</p>', '', 2900, 'publish', 36, 181, 3, 44, 0, 1, 0, '2016-07-13 00:58:45', '2016-09-08 14:55:09', NULL),
(129, 'btrurj-lovely-jack-russell-puppies-for-free-ad-43', 'Lovely Jack Russell puppies for free.', '<p>Cute Jack Russell puppies for any good home. They are 12 weeks old and very healthy, social, loving, and have excellent personalities. We spend a lot of time with our puppies. They are truly lovable pups. Puppies are 12 weeks old now, we have 1 male and 1 female available.&nbsp;</p>\r\n<p>Email;<span style="font-family: \'Helvetica Neue\', \'Segoe UI\', Helvetica, Arial, \'Lucida Grande\', sans-serif; font-size: 1.6rem; line-height: 16px; white-space: nowrap;">honessy_lopez@yahoo.com</span></p>\r\n<p><span style="font-family: \'Helvetica Neue\', \'Segoe UI\', Helvetica, Arial, \'Lucida Grande\', sans-serif; font-size: 1.6rem; line-height: 16px; white-space: nowrap;">&nbsp;</span></p>', '', 1400, 'publish', 36, 181, 3, 42, 0, 2, 0, '2016-07-13 01:09:16', '2016-09-09 12:23:59', NULL),
(130, 'hcm9yb-adorable-blue-and-gold-macaw-parrots-ad-90', 'Adorable Blue and Gold Macaw Parrots.', '<p>Great Blue Gold Macaws Parrots Now ready.This babies are very good boys and a girl.They steps up on command, can whistle parts of the Andy Griffith theme, is beginning to try to vocalize words/sounds, if you say "pretty girl" They will whistle, and are not a noisy birds. For their young age They are very intelligent.They also enjoys their toys, loves to sit on her perch and "take in" daily, household activities.</p>\r\n<p>Macaws typically begin speaking clearly around 1-2 years old.</p>', '', 2400, 'publish', 35, 183, 2, 40, 0, 1, 0, '2016-07-13 10:03:16', '2016-09-10 12:15:51', NULL),
