(16, 16, 'Sankata Computer Enterprises', 'vF1I49_12874434-10153945335508956-1114547743-o.jpg', 'Sankata Computer Enterprise introduce itself as a team of highly efficient, dedicated & professional Technician providing quality services. It has been providing & promoting its dedicated services in various computer related sector . With a long history of experiment , in – house training & experimentation we have now reached the point where we can provide total solution & service of the highest quality in the computer industry utilizing the latest technology.\r\n\r\nSpecifically,  Sankata computer deal in computer system, peripherals, and accessories provides maintenance service after sale. Systems analysis, development and implementation are also the field sankata computer works on. Developing local intranet and internet working based on different systems are offered as well.\r\n', 'www.sastobazar.com', '9851018034', '014254640', '014239648', 'Nachee galli', 'New road', 1, 'Nepal', 1, 1, 1, 0),
